import React from "react";
import { IEmoji } from "../../models";
import { emojis } from "../../data/emojis";

interface EmojiProps {
  emoji: IEmoji;
}

export const Emoji = (emoji: IEmoji) => {
  return (
    <li>
      <p>{emoji.title}</p>
      <p>{emoji.keywords}</p>
      <p>{emoji.symbol}</p>
    </li>
  );
};
